'toolkit/chrome/global/aboutRights.dtd:rights.webservices-term4' => 'ఈ  సేవలను   &#34;యధాస్థితిగా&#34; అందచేయబడుతున్నవి.     &amp;vendorShortName;, దాని  సహాయకులు, లైసెన్సు దారులు, పంపిణీ దారులు   , ఇవి వ్యాపారానికి  సరి అయినవని , మీ అవసరాలకు సరిపోతాయని , వీటి నాణ్యత గురించి  వివరించబడిన, లేక అనుకొనబడిన హామీలకు  ఏ హద్దు లేకుండా భాద్యత వహించరు.  సేవలను ఎంచుకోవటంవలన , వాటి నాణ్యతవలన కలిగే లాభనష్టాలకి మొత్తము బాధ్యత   మీదే . కొన్ని ప్రాంతాలలో  అనుకోబడిన హామీలను  తీసివేయటానికి, లేక భాద్యత గ్గించటానికి  అనుమతి లేకపోతే, ఈ  షరతు మీకు వర్తించదు.',
'toolkit/chrome/global/aboutRights.dtd:rights.webservices-term5' => 'చట్ట పరిధికి  అవసరమైనవి మినహాయించి, &amp;vendorShortName;, దాని  సహాయకులు, లైసెన్సు దారులు మరియు  పంపిణీ దారులు,  &amp;brandShortName; యొక్క సేవలను  వాడుటం వలన  కలిగిన    అన్ని  రకాల  నష్టాలకు  భాద్యత  వహించరు. సమీష్ఠి భాద్యత   $500 (ఐదు వందల డాలర్లు) లోబడి వుంటుంది. కొన్ని ప్రాంతాలలో   సష్టాల భాద్యతను  తీసివేయటానికి, లేక భాద్యత గ్గించటానికి  అనుమతి లేకపోతే, ఈ షరతు  మీకు వర్తించదు.',
